        version,
        chainId,
    );

    // The following value was generated by `yarn-project/stdlib/src/hash/hash.test.ts`
    let hash_from_typescript = 0x0081edf209e087ad31b3fd24263698723d57190bd1d6e9fe056fc0c0a68ee661;

